Set against the urban jungle of 1963 New York's gangland subculture, this coming 
of age teenage movie is set around the Italian gang the Wanderers. Slight 
comedy, slight High School angst and every bit entertaining with its classic 
1950's Rock n' Roll soundtrack such as &quot;Walk Like a Man&quot;, &quot;Big Girls Don't Cry&quot; 
by The Four Seasons and &quot;My Boyfriend's Back&quot; by The Angels. Focusing around a 
football game where the different gangs play with and against each other, then 
at its grand finale, come together in a mass of union to defend their honour and 
their turf. Nostalgic stuff and above all a Rock n' Roll retrospective on a 
grand musical era. Timeless.
